void synthSampler_Processor_setNote(synthSampler_Processor__ctx_type_1 &_ctx, fix16_t gate, fix16_t voct, fix16_t vel, int cable){
   fix16_t velocity;
   velocity = fix_mul(0x7f0000 /* 127.000000 */,fix_clip(vel,0x0 /* 0.000000 */,0x10000 /* 1.000000 */));
   if(velocity == 0x0 /* 0.000000 */){
      velocity = 0x7f0000 /* 127.000000 */;
   }
   if(bool_not(_ctx.last_gates[cable]) && (gate >= 0x1999 /* 0.100000 */)){
      _ctx.last_gates[cable] = true;
      _ctx.last_pitches[cable] = synthSampler_Processor_cvToPitch(voct);
      synthSampler_Voice_noteOn(_ctx.voice,_ctx.last_pitches[cable],fix_to_int(velocity),0);
   }
   else
   {
      if(_ctx.last_gates[cable] && (gate < 0x1999 /* 0.100000 */)){
         if(_ctx.last_pitches[cable] >= 0){
            synthSampler_Voice_noteOff(_ctx.voice,_ctx.last_pitches[cable],0);
         }
         _ctx.last_gates[cable] = false;
         _ctx.last_pitches[cable] = (-1);
      }
   }
}

void synthSampler_Processor_nbCables(synthSampler_Processor__ctx_type_1 &_ctx, int nbcables){
   if(nbcables != _ctx.last_nbcables){
      _ctx.last_nbcables = nbcables;
      int c;
      c = nbcables;
      while((c < 16) && (c < 16)){
         if(_ctx.last_gates[c] && (_ctx.last_pitches[c] >= 0)){
            synthSampler_Voice_noteOff(_ctx.voice,_ctx.last_pitches[c],0);
         }
         _ctx.last_gates[c] = false;
         _ctx.last_pitches[c] = (-1);
         c = (1 + c);
      }
   }
}

void synthSampler_Processor_default(synthSampler_Processor__ctx_type_1 &_ctx){
   synthSampler_Voice_default(_ctx.voice);
   synthSampler_Processor_setSamplerate(_ctx,0x2c1999 /* 44.100000 */);
   synthSampler_Voice_synthSetLoop(_ctx.voice,true);
   synthSampler_Voice_synthSetLoopStart(_ctx.voice,5073);
   synthSampler_Voice_synthSetLoopEnd(_ctx.voice,5992);
}


